import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click the 'My Events' navigation link
    await page.waitForSelector("a.nav-link[href='dashboard.html']");
    await page.click("a.nav-link[href='dashboard.html']");
    await page.waitForLoadState('networkidle');

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_navigated_to_my_events.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_navigated_to_my_events.png'));

    // Verify successful navigation
    const currentUrl = page.url();
    const isOnMyEventsPage = currentUrl.includes('dashboard.html');

    return {
      success: isOnMyEventsPage,
      action: isOnMyEventsPage ? "Navigated to My Events page successfully" : "Failed to navigate to My Events page",
      extractedData: { currentUrl },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

