    const currentUrl = page.url();

    return {
      success: true,
      action: "Navigated to 'My Events' page successfully",
      extractedData: {
        pageTitle,
        currentUrl
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
